import React, { useState } from 'react'

function Logical() {
    const[toggle,setToggle]=useState()
    const handleClick =()=>{
setToggle(!toggle)
    }
  return (
    <div>
      <button onClick={handleClick()}></button>
      <p>{toggle && "the button is on"}</p>
      {!toggle && <p></p>}
    </div>
  )
}

export default Logical
